import React, {useEffect} from "react";
import {readDecks} from "../utils/api/index";

function Study({decks, setDecks}) {
    //use readDeck from utils

    useEffect(() => {
        async function loadData() {
            try {
                const data = await readDecks();
                setDecks(data);
            }// end of try
            catch(error) {
                console.log(error)
            }// end of catch
        } // end of loadData()
        loadData();
    },[]) //end of effect



}

export default Study;
